import React from 'react'
import c from './ModelItem.module.css'
export const ModelItem = (props) => {
  return (
    <div>
        <img src="" alt="" />
        <div className={c.name}>
            {props.name}
        </div>
        <div className={c.description}>
            {props.description}
        </div>
        <div className={c.id}>
            Код товару: {props.id}
        </div>
        {props.sale?<div className={c.cost}>
            <div className={c.sale}>{props.cost}₴</div>
            {props.sale}₴
        </div>:<div className={c.cost}>
            {props.cost}₴
        </div>}
        
    </div>
  )
}
